	(116, 'CNTS_200000000007333', '쇼핑', '더솜라탄', '제주시', '제주시내', '제주특별자치도 제주시 노형동 3808-13', '제주특별자치도 제주시 노형1길 8-9', '쇼핑,라탄,원데이클래스,관광기념품,상점/상가', '제주 시내에 있는 더솜라탄은 잔잔한 분위기를 가지고 있는 가게이다. 공방을 함께 운영하고 있어 라탄을 직접 배우기에도 알맞다. 8월부터는 다양한 코스의 수업도 진행하는데, 라탄을 처음 접하는 사람들을 위한 초급반부터 중급반까지 자신의 수준에 맞는 라탄 수업을 들을 수 있다.', '33.48309800000001', '126.4772312', '010-8987-6464', 'https://api.cdn.visitjeju.net/photomng/imgpath/201808/07/d2a04ffa-5d67-4417-a584-2a218206e3d4.jpg', 'https://api.cdn.visitjeju.net/photomng/thumbnailpath/201808/07/c3e66ac9-5eda-4ea3-a51c-6967e2e0b77d.jpg'),
