	(2043, 'CNTS_200000000010794', '숙박', '청재설헌', '서귀포시', '서귀포시내', '제주특별자치도 서귀포시 토평동 3045', '제주특별자치도 서귀포시 인정오름로 135-18', '겨울,숙박,숙소,힐링,힐링쉼터,온돌방,조식 포함,농어촌민박,민박,휴양펜션,펜션,주차장', '청재설헌은 ‘Bed and Breakfast’라는 슬로건을 추구한다. 각종 비타민이나 영양식을 추구하는 현대인은 이해 할지 모르겠다. 하지만 우리네 어머니들이 늘 말씀하시던 한결같은 말 중에 “건강하려면 단잠을 자고 제 때 끼니를 잘 먹어야한다”고 하셨다.\n2000년 11월 처음 문을 연 청재설헌은 더도 덜도 없이 그 말 그대로를 실천하는 내츄럴 숙박시설이다. \'Bed\'는 잘 자는 것, ‘Breakfast’는 아침식사를 하는 것을 말한다. 청재설헌에서는 주인과 객이 함께 아침식사를 하는 곳이다. 호화스러운 호텔이나 여타 숙박시설과 달리 청재설헌 건물은 소박하게 지어졌다. 서귀포 토평동 중산간 자락, 한라산 남사면이라 어느 곳이든 한라산 정상이 한눈에 보이는 지역의 특성을 고려한 듯, 숙소 앞 정원에서도 건물 지붕 뒤로 한라산을 가리지 않는다.', '33.2891483', '126.5718271', '064-732-2020', 'https://api.cdn.visitjeju.net/photomng/imgpath/202011/03/595a2bd0-7ff2-44f0-beee-5c307754e9e2.jpg', 'https://api.cdn.visitjeju.net/photomng/thumbnailpath/202011/03/09c2a083-88e5-492c-b9c8-689766a5ca93.jpg'),
