	(2744, 'CNTS_200000000010695', '숙박', '돌담한길펜션', '서귀포시', '남원', '제주특별자치도 서귀포시 남원읍 한남리 307-3', '제주특별자치도 서귀포시 남원읍 한신로 55', '숙소,힐링,휴양펜션,펜션,힐링쉼터,독채,자연경관,바비큐,공공와이파이존,주차장', '제주도 서귀포시 남원읍은 제주에서도 날씨가 좋은 곳으로 알려진 마을이다. 봄철에는 제주특산물로 유명한 고사리축제가 열리고, 감귤이 익어가는 풍경이 아름다워 ‘귤림추색’(감귤이 익어가는 가을풍경)이라고 불릴 정도. 제주도민들도 남원읍은 살기 좋은 고장이라 한다고.  \n돌담한길펜션은 72년 전통가옥을 현대식으로 리모델링해 내 집처럼 편안한 독채형 펜션이다. 대형 숙박시설이 아니라 단 2개의 객실만 운영하고 있는 소박한 제주 살림집스러운데 실내에 들어서면 70년 전 천장 서까래가 그대로 드러나 옛 분위기가 물씬 풍기고, 안방에는 편백나무 침대가 건강한 수면을 도와주고 창밖으로는 감귤밭이 한눈에 들어온다. 겉은 옛집이지만 화장실, 주방, 거실 등 모든 이용시설은 이용하기 편리한 현대식으로 개조했다.', '33.3352599', '126.6681117', '010-4690-4303', 'https://api.cdn.visitjeju.net/photomng/imgpath/202010/07/d6204c7a-cc0a-4aaa-9e99-497d5879c7b6.jpg', 'https://api.cdn.visitjeju.net/photomng/thumbnailpath/202010/07/dfce190e-0e27-41e3-93a6-65161a89f2b5.jpg'),
