	(4835, 'CNTS_200000000009481', '관광지', '조선한의원', '제주시', '제주시내', '제주특별자치도 제주시 노형동 682', '제주특별자치도 제주시 진군남4길 7-1', '의료관광', '아름다운 얼굴과 건강한 몸은 모든 여성들의 꿈이다. 조선한의원은 한방 피부 미용과 다이어트 프로그램을 통하여 여성들에게 건강한 아름다움을 되찾는데 도움을 준다. \n전통 한의학 이론과 최신 서양 의학 지식을 결합한 차별화 된 진료에서 자연스럽고 건강한 아름다움을 만나보자.', '33.48309800000001', '126.4772312', '064-712-7775', 'https://api.cdn.visitjeju.net/photomng/imgpath/201911/12/a3468c1c-a104-4299-ab33-f4752ce05e69.JPG', 'https://api.cdn.visitjeju.net/photomng/thumbnailpath/201911/12/06376f61-0e0b-4f76-9bc8-86b8a185b93c.JPG'),
	(4836, 'CONT_000000000500890', '숙박', '바다파파', '제주시', '조천', '제주특별자치도 제주시 조천읍 신촌리 557', '제주특별자치도 제주시 조천읍 신촌10길 7', '민박,독채,펜션,가족,바비큐,공공와이파이존,단체여행객,해수욕장,수상레저', '제주도 바닷가 앞, 가족펜션과 농장을 운영하는 바다파파입니다.', '33.5351405', '126.6258231', '064-752-3551', 'https://api.cdn.visitjeju.net/photomng/imgpath/201804/30/ee57f586-f271-4faf-9070-1e23170adde8.jpg', 'https://api.cdn.visitjeju.net/photomng/thumbnailpath/201804/30/26fac5ca-5412-48d4-aec1-cddd4aa1c97b.jpg'),
	(4837, 'CNTS_200000000009483', '관광지', '제주한라병원', '제주시', '제주시내', '제주특별자치도 제주시 연동 1963-2', '제주특별자치도 제주시 도령로 65', '의료관광', '환자의 생명과 건강을 내 몸처럼 돌본다는 뜻의 ‘이명아명’(爾命我命)을 원훈으로 삼고, 1983년 10월 개원했다. 병원 규모는 지하 2층, 지상 10층 규모의 건물 2동에 26개 진료과목을 개설하고 600 병상을 보유하고 있는 제주지역 최대 병원이다. 2011년부터 정부가 공인하는 의료기관으로, 역량있는 의료진과 첨단 의료장비를 갖추고 있으며, 중증 응급(외상)환자를 최종 진료하는 권역응급의료센터와 권역외상센터를 운영하며, 골든아워내 적절한 치료로 단 한 사람의 생명이라도 잃는 일이 없도록 노력하고 있다.', '33.4898195', '126.4851928', '064-740-5000', 'https://api.cdn.visitjeju.net/photomng/imgpath/201911/13/80147126-0e29-4979-bfca-8fd469591e18.jpg', 'https://api.cdn.visitjeju.net/photomng/thumbnailpath/201911/13/b5affb04-e412-4af2-994e-9d9cde18de9d.jpg'),
