	(4897, 'CNTS_200000000009480', '관광지', '서귀포의료원', '서귀포시', '서귀포시내', '제주특별자치도 서귀포시 동홍동 1530-2', '제주특별자치도 서귀포시 장수로 47', '의료관광', '1964년 제주도립병원 서귀포분원으로 개원하여 2013년 10월, 지하2층 지상4층으로 신축이전하여 현재 18개 진료과와 300병상을 갖춘 서귀포시의 유일한 종합병원으로 128체널 CT, 3.0T MRI 등 첨단 의료장비 도입을 통해 최적의 진료환경을 구축했다. 또한 심·뇌혈관센터운영, 고압산소센터운영, 24시간 분만산부인과 운영, 안과개설 등 지역특성에 맞는 진료센터를 통해 진료의 수준을 한단계 더 높였다. 또한 제주도 최초 간병부담을 덜어주는 간호·간병통합서비스병동 운영을 통해 지역 주민의 의료비 부담을 최소화 하였고, 취약계층 의료지원 및 예방접종사업, 찾아가는 산부인과 등의 다양한 공공의료사업을 전개해 나가고 있다. ', '33.2557649', '126.5645342', '064-730-3000', 'https://api.cdn.visitjeju.net/photomng/imgpath/201911/12/6263a360-bace-4cfd-ab73-fc3d6dcedd98.jpg', 'https://api.cdn.visitjeju.net/photomng/thumbnailpath/201911/12/7ba9bbb0-740d-4f10-bfa4-91a36c892422.jpg'),
